import React from "react";

class TopBar extends React.Component {
    render = () => {
        return (
            <Navbar className = "top-bar">
                <Container>
                    <Navbar.Brand> Auto-CT </Navbar.Brand>
                </Container>
            </Navbar>
        )
    }
}
export default TopBar;
